import React from 'react';
import { Link } from 'react-router-dom';
import "../styles/topbar.css";

export default function Topbar() {

  const user = true;

  return (
    <div className="topbar">
      <h1 className="top-logo"><Link to="/">HOME</Link> </h1>
      <ul className="topbar-list">
        <li className="list-item">
          <Link to="/about">ABOUT</Link>  
        </li>
        <li className="list-item">  
          <Link to="/contact">CONTACT</Link>
        </li>
        <li className="list-item">
          <Link to="/write">WRITE</Link>
        </li>
        <li className="list-item">
          <Link to="/logout">LOGOUT</Link>  
        </li>
      </ul>
      <div className="img-search">
        {
          user ? (
            <Link to="/account">
              <img className="top-img" src="https://images.pexels.com/photos/5588373/pexels-photo-5588373.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" alt="blog" />
            </Link>
          ) : (
            <ul className="topbar-list">
              <li className="list-item"><Link to="/login">LOGIN</Link></li>
              <li className="list-item"><Link to="/register">REGISTER</Link></li>
            </ul>
          )
        }
        <i class="top-search fas fa-search"></i>
      </div>
    </div>
  )
}
